import { useLocation } from 'react-router-dom';
import './TelaAndar.css'
import Andar from '../../compontente/Andar/Andar';
import BotaoPrecisao from '../../compontente/BotaoPrecisao/BotaoPrecisao';

function TelaAndar(){
    const location = useLocation();
   var local = location.state.id
   console.log(local)
   var teste = []
   for(var x=0; x<local[1]; x++){
        teste.push(x)
    }
return(
    <div className='TelaAndar'>
    <div className='EstanteAndar'>
    
    {teste.map((i)=>{
        if(i==local[0].floor-1){
            return(
               <Andar key={i}  escolhido={true}/>
                )        
        }else{
            return(
                <Andar key={i}  escolhido={false}/>
                )
        }
        
    })}

   
    </div>    
    </div>
)
}
export default TelaAndar;
